import React from 'react';
import '../styles/Favorites.css';
import PetCard from './PetCard';

function FavoritesPage({ favorites }) {
  return (
    <div className="favorites-page">
      <h2>Favorite Pets</h2>
      {favorites.map((pet) => (
        <PetCard key={pet.id} pet={pet} />
      ))}
    </div>
  );
}

export default FavoritesPage;
